const Table = ({ postsList }) => {
  return (
    <table className="table table-striped">
      <thead>
        <tr>
          <th scope="col">Id</th>
          <th scope="col">Title</th>
        </tr>
      </thead>
      <tbody>
        {Array.isArray(postsList) ? (
          <>
            {postsList.map(({ userId, id, title, body }) => (
              <tr>
                <th scope="row">{id}</th>
                <td>{title}</td>
              </tr>
            ))}
          </>
        ) : null}
      </tbody>
    </table>
  );
};
export default Table;
